import React, { useState, useEffect } from 'react';
import { IonCard, IonCardContent, IonCardHeader, IonCardTitle, IonImg } from '@ionic/react';

const ImageList = () => {
  const [images, setImages] = useState([]);

  useEffect(() => {
    // Chame a função para buscar imagens quando o componente for montado
    const fetchData = async () => {
      const data = await fetchImages();
      setImages(data);
    };
    fetchData();
  }, []);

  return (
    <div>
      {images.map((image) => (
        <IonCard key={image.id}>
          <IonImg src={image.url} alt={image.description} />
          <IonCardHeader>
            <IonCardTitle>{image.title}</IonCardTitle>
          </IonCardHeader>
          <IonCardContent>{image.description}</IonCardContent>
        </IonCard>
      ))}
    </div>
  );
};

export default ImageList;
